import React from 'react';

const FontAwesomeIcon = require('react-fontawesome');

const Arrows = props => {
    return (
        <div className="arrows-wrapper">
            <span href="#" onClick={props.moveSliderLeft}>
                <FontAwesomeIcon
                    
                    className='fa-left mr-4'
                    name="fas fa-angle-left"
                    size='3x'
                    style={{ textShadow: '0 1px 0 rgba(0, 0, 0, 0.1)' }}
                />
            </span>
            
            <span onClick={props.moveSliderRight} href="#">
                <div>Icons made by <a href="https://www.flaticon.com/authors/lyolya" title="Lyolya">Lyolya</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
            </span>
        </div>
    )
}

export default Arrows;
